import React from 'react'
import { GaleryItem } from '../galery/galeryItem/GaleryItem'

export const GaleryList = ({paintings}) => {
  return (
    <ul>
        {paintings.map(({id, ...paints}) => {
        return <GaleryItem key={id} paint={paint}/>
      })}
    </ul>
  )
}
